import React from "react";
import "../Style/navigationStyle.css";
const Header = () => {
  const handleLogout = () => {
    // Perform logout logic here
    // For example, clear the token from localStorage or perform any other necessary actions
    localStorage.removeItem("token");
    // Redirect the user to the login page or any other desired page
    window.location.href = "/";
  };

  return (
    <header>
      <div className="logo">Logo</div>
      <nav>
        <ul>
          <li>
            <a href="/home">Poƒçetna</a>
          </li>
          <li>
            <a href="/favorite">Omiljeni tabovi</a>
          </li>
          <li>
            <a href="/addtab">Dodaj</a>
          </li>
          <li>
            <a href="/archive">Arhiva tabova</a>
          </li>
          <li>
            <a href="/profile">Profil</a>
          </li>
          <li>
            <div className="logout-button">
              <button onClick={handleLogout}>Odjava</button>
            </div>
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
